ControlPropertyState.AutoRuleBindingString:
If(
	IsBlank(dtpProdStageDrawST14.SelectedDate), 
	Notify("Please fill in all required fields", NotificationType.Error), 
	UpdateContext({existingRecordST14: LookUp(ECN_Stage14, ES014_ECNReference.Value = SelectedECNNo.ES001_ECNReference)} );
	If( 
        !IsBlank(existingRecordST14),
        Patch( ECN_Stage14, existingRecordST14, 
				{
					ES014_Prod_Stage_Drawing_Date: dtpProdStageDrawST14.SelectedDate,					
					ES014_ECNReference: { Value: SelectedECNNo.ES001_ECNReference, Id: LookUp( ECN_Stage1, ES001_ECNReference = SelectedECNNo.ES001_ECNReference).ID}					
                    //,ES014_ModifyBy: { Value: varUser.User_Name, Id: LookUp(ECN_UserMaster,User_Id = varUser.User_Id).ID}
				}
        ),
        Patch( ECN_Stage14, Defaults(ECN_Stage14),
				{
					Title: SelectedECNNo.ES001_ECNReference, 
					ES014_Prod_Stage_Drawing_Date: dtpProdStageDrawST14.SelectedDate, 					
					ES014_ECNReference: { Value: SelectedECNNo.ES001_ECNReference, Id: LookUp( ECN_Stage1, ES001_ECNReference = SelectedECNNo.ES001_ECNReference).ID}
                    //,ES014_ModifyBy: { Value: varUser.User_Name, Id: LookUp(ECN_UserMaster,User_Id = varUser.User_Id).ID}
				}
			)
    );	
	If(
        !IsEmpty(Errors(ECN_Stage14)), Notify( "An error occurred while saving the record.", NotificationType.Error),
        Patch(
			ECN_Stage1, 
			LookUp(ECN_Stage1,ES001_ECNReference = SelectedECNNo.ES001_ECNReference),
            { ES001_CurrentStage: { Value: "StageClose", Id: LookUp( ECN_StageMaster, Stage_Id = "15").ID }	}
        );
        Notify("Record saved successfully!", NotificationType.Success)
    );    
	Navigate(frmHome)

)
